import { sickData } from 'redux/reducer/searchSlice';

export interface Indexable extends sickData {
  [key: string]: string | [];
  data: [];
}
// 변수 : 타입 형태로

export const sickNmMap = ({ sickNm, data }: Indexable) => {
  data.map(el => {
    return {
      sickNm: el.sickNm,
    } as Indexable;
  });
};
